import store from './store';
import * as action from './action.types';

//store.dispatch({type: 'UPDATE_NAME', payload: 'tonic'})

export function deleteWebPreview(WebPreview) {
    store.dispatch({ type: action.DELETE_WEB_PREVIEW, payload: WebPreview })
}

export function updateWebPreview(WebPreview) {
    store.dispatch({ type: action.UPDATE_WEB_PREVIEW, payload: WebPreview })
}

export function createWebPreview(WebPreview) {
    store.dispatch({ type: action.CREATE_WEB_PREVIEW, payload: WebPreview })
}

export function deleteWebElement(element) {
    store.dispatch({ type: action.DELETE_WEB_ELEMENT, payload: element })
}

export function updateWebElement(element) {
    store.dispatch({ type: action.UPDATE_WEB_ELEMENT, payload: element })
}

export function updateStyling(element) {
    store.dispatch({ type: action.UPDATE_STYLING, payload: element })
}

export function createWebElement(element) {
    store.dispatch({ type: action.CREATE_WEB_ELEMENT, payload: element })
}
